import React from "react";

const Table = (props) => {
    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>id</th>
                        <th>Name</th>
                        <th>Amount</th>
                        <th>Time</th>
                        <th>Discription</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        props.data?.map((value, key) => {
                            return (
                                <tr key={key}>
                                    <td>{value.type}</td>
                                    <td>{value.id}</td>
                                    <td>{value.name}</td>
                                    <td>{value.amount}</td>
                                    <td>{value.time}</td>
                                    <td>{value.discription}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
            </table>
        </>
    );
}

export default Table;
